import React, { useState } from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, 
    IonInput, IonItem, IonLabel, IonList, IonItemDivider, IonDatetime } from '@ionic/react';
import './Tab1.css';

const Tab1: React.FC = () => {

    const [text, setText] = useState<string>();
    const [number, setNumber] = useState<number>();
    var today = new Date();

    const todaysDate =() => {
        return today; 
    }
    return (
        <IonPage>
          <IonHeader>
            <IonToolbar>
              <IonTitle>Enter Data</IonTitle>
            </IonToolbar>
          </IonHeader>
          <IonContent>
            <IonList>
              <IonItemDivider>Name</IonItemDivider>
              <IonItem>
                <IonInput value={text} placeholder="Enter Input" onIonChange={e => setText(e.detail.value!)}></IonInput>
              </IonItem>

              <IonItemDivider>Hours Worked</IonItemDivider>
              <IonItem>
                <IonInput type="number" value={number} placeholder="Enter Number" onIonChange={e => setNumber(parseInt(e.detail.value!, 10))}></IonInput>
              </IonItem>

              <IonItemDivider>Date</IonItemDivider>

              <IonItem>
                <IonLabel>{todaysDate}</IonLabel>
                <IonDatetime></IonDatetime>
              </IonItem>

              <IonItem>
                <IonLabel position="floating">Floating Label</IonLabel>
                <IonInput value={text}></IonInput>
              </IonItem>

              <IonItem>
                <IonLabel position="fixed">Fixed Label</IonLabel>
                <IonInput value={text}></IonInput>
              </IonItem>

              <IonItem>
                <IonLabel position="stacked">Stacked Label</IonLabel>
                <IonInput value={text}> </IonInput>
              </IonItem>
            </IonList>
          </IonContent>
        </IonPage>
      );
};

export default Tab1;
